const SideEffect = require('./side-effect');

const id = 'downloadAppStore';

const donwloadAppLinkEnhancement = (url) => {
  const newUrl = { ...url,
    SideEffect,
    link: { ...url.link, id: 'nav-header-menu-download-mobile' } };

  return newUrl;
};

